import { useContext, useRef, createContext, ReactNode } from "react";

type CvRuslanContextProps = {
  children: ReactNode;
};

type CvRuslanContextContainerProps = {
  test: string;
  navpanelRef: HTMLInputElement;
};

const CvRuslanContextContainer = createContext({} as CvRuslanContextContainerProps);

export const useCvRuslanContext = () => {
  return useContext(CvRuslanContextContainer);
};

const CvRuslanContext = ({ children }: CvRuslanContextProps) => {
  let test = "sss";
  const navpanelRef = useRef<HTMLInputElement>();

  return (
    <CvRuslanContextContainer.Provider value={{ test, navpanelRef }}>{children}</CvRuslanContextContainer.Provider>
  );
};

export default CvRuslanContext;
